import React, { Component } from 'react';
import CovidInspection from './covid-inspection';
import CovidTestedStatus from './covid-tested-status';
import CovidNewsList from './covid-news';

class App extends Component {
  render() {
    return (
      <div>
        <CovidInspection />
        <CovidTestedStatus />
        <CovidNewsList />
      </div>
    );
  }
}

export default App;
